import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Img from "react-image";
import SEO from "react-seo-component";

// Layout
import Layout from "../components/Layout";
import Message from "../common/Message";

function Listening({ statusCode }) {
  return (
    <Layout>
      <Container>
        <SEO
          title="Listening Exercises | CXC Spanish Online"
          description={
            "Practice listening with recordings of conversations with native Spanish speaker for your CXC Spanish exam."
          }
          pathname={"https://www.cxcspanish.com/listening"}
          siteLanguage={"en"}
          siteLocale={""}
          twitterUsername={"_rxheem"}
        />

        <Breadcrumb>
          <BreadcrumbItem>
            <a href="/">Home</a>
          </BreadcrumbItem>
          <BreadcrumbItem active>Listening Exercises</BreadcrumbItem>
        </Breadcrumb>

        <Row>
          <Col sm={12} md={8} lg={8} xl={8}>
            <Card>
              <CardHeader>Card header</CardHeader>

              <CardBody>
                <CardTitle>Lorem Ipsum</CardTitle>
                <p>Lorem ipsum dolor sit amet.</p>
                <Button>Read more &rarr;</Button>
              </CardBody>
              <CardFooter>Card footer</CardFooter>
            </Card>
          </Col>
          <Col sm={12} md={4} lg={4} xl={4}></Col>
        </Row>
      </Container>
    </Layout>
  );
}

Error.getInitialProps = ({ res, err }) => {
  const statusCode = res ? res.statusCode : err ? err.statusCode : 404;
  return { statusCode };
};

export default Listening;
